drop database if exists rentacar;
create database rentacar character set utf8;
use rentacar;

create table vozilo(
sifra 				int not null primary key auto_increment,
naziv 				varchar(50) 	not null,
tip 				varchar(50) 	not null,
registracija                    varchar(10) 	not null,
boja 				varchar(50) 	not null,
grupavozila                     varchar(50)	not null,
vrstagoriva                     varchar(50) 	not null
)engine=innodb;

create table grupa(
sifra 				int not null primary key auto_increment,
naziv 				varchar(50) 	not null,
vozilo           		varchar(50) 	not null,
registracija                    varchar(10) 	not null,
opremavozila                    varchar(500)    not null
)engine=innodb;

create table oprema(
sifra 				int not null primary key auto_increment,
naziv				varchar(50) 	not null,
nazivvozila             	varchar(50)	not null,
vrijednost	 		varchar(500)
)engine=innodb;

create table ugradeno(
sifra 				int not null primary key auto_increment,
vozilo				int		not null,
oprema				int		not null,
rezervacija                     int             not null
)engine=innodb;

create table osoba(
sifra                           int not null primary key auto_increment,
oib 				char(11) 	not null,
ime 				varchar(50) 	not null,
prezime 			varchar(50) 	not null,
datumrodenja                    date,
adresa				varchar(50) 	not null,
mjesto				varchar(50) 	not null,
telefon				varchar(20),
brojosobne			varchar(25),
brojvozacke			varchar(30),
email 				varchar(50)
)engine=innodb;

create table djelatnik(
sifra 				int not null primary key auto_increment,
iban 				varchar(21),
osoba                           int             not null
)engine=innodb;

create table klijent(
sifra 				int not null primary key auto_increment,
osoba                           int             not null
)engine=innodb;

create table rezervacija(
sifra 				int             not null primary key auto_increment,
osoba                           int             not null,
naziv                           varchar(50) 	not null,
nazivvozila			varchar(50)     not null,
cijenapodanu                    decimal(18,2),
brojdananajma                   int,
ukupnacijena                    decimal(18,2),
datumpodizanja                  datetime,
datumvracanja                   datetime,
popust                          decimal(18,2)
)engine=innodb;

create table clan(
grupa                            int            not null,
klijent                          int            not null
)engine=innodb;

create table operater(
sifra                           int             not null primary key auto_increment,
ime                             varchar(50)     not null,
prezime                         varchar(50)     not null,
korisnik                        varchar(50),
lozinka                         char(32)
)engine=innodb;

create unique index i1 on operater(korisnik);



alter table ugradeno     add foreign key (vozilo)               references vozilo(sifra);
alter table ugradeno     add foreign key (oprema)               references oprema(sifra);
alter table ugradeno     add foreign key (rezervacija)          references rezervacija(sifra);

alter table djelatnik 	 add foreign key (osoba) 		references osoba(sifra);

alter table klijent 	 add foreign key (osoba) 		references osoba(sifra);

alter table clan add foreign key (grupa) references grupa(sifra);
alter table clan add foreign key (klijent) references klijent(sifra);

